import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AboutUs } from './components/AboutUs';
import { Onas } from './components/Onas'; 
import { Zapis } from './components/Zapis'; 
import { Adres } from './components/Adres'; 

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<AboutUs />} /> {/* Главная страница */}
        <Route path="/Onas" element={<Onas />} /> {/* Страница "О нас" */}
        <Route path="/Zapis" element={<Zapis />} /> {/* Страница "Запись" */}
        <Route path="/Adres" element={<Adres />} /> {/* Страница "" */}
      </Routes>
    </Router>
  );
}

export default App;
